#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <limits.h>

typedef struct map{
   int idx;
   int val;
} map;
void init(map* hash, int size) {
     for (int i = 0; i < size; i++) {
         hash[i].idx = 0;
         hash[i].val = 0;
     }
}
void add(int idx, int top, map* hash) {
     hash[top].idx = idx;
     hash[top].val = 0;
     top++;
}

int has(map* hash, int idx, int size) {
    for (int i = 0; i < size; i++) {
        if (hash[i].idx == idx && !hash[i].val) {
           hash[i].val++;
           return 1; 
        }
    }
    return 0;
}
void strCpy(char* s, char* d, int from, int size) {
     for (int i = 0; i < size; i++) {
         d[i] = s[from+i];
     }
}
char** findRepeatedDnaSequences(char* s, int* returnSize) {
    int mapsize = 1024*1024;
    map* hash = (map*)malloc(sizeof(map)*mapsize);
    init(hash, mapsize);
    int top = 0;
    
    char** rst = (char**)malloc(sizeof(char*) * 5000); 
    memset(rst, 0, sizeof(rst));
    int len = strlen(s), size = -1;
    
    int bit = 0, i = 0;
    for (; i < 9; i++) {
        bit = bit << 3 | s[i] & 0x7; 
    }
    add(bit, top++, hash);
    for (; i < len; i++) {
        bit = bit << 3 & 0x3FFFFFFF | s[i] & 0x7;

        if (has(hash, bit, top) == 1)  {
           rst[++size] = (char*)malloc(sizeof(char)*10);
           memset(rst[size], 0, sizeof(rst[size]));
           strCpy(s, rst[size], i-9, 10);
        } else {
           add(bit, top, hash);   
           top++;    
        }
    }
    
    *returnSize = size+1;
    //printf("%d",size);
    return rst;
}

int main(){
    char* s = "";
    int* size = (int*)malloc(sizeof(int));
    *size = 0;
    char** rst = (char **)malloc(sizeof(char *) * 100); 
    printf("%d",strlen(s));
    rst = findRepeatedDnaSequences(s, size);
    for(int i = 0; i < *size; i++) {
       printf("%s\n",rst[i]);
    }
   // printf("%5d\n",a); 
    system("pause"); 
    return 0;
}